';\n            position: absolute;\n            top: -1px;\n            left: 0;\n            mix-blend-mode: soft-light;\n            animation: dance 2s infinite steps(2);\n        }\n\n        body div#error h3:before {\n            clip-path: polygon(0 0, 100% 0, 100% 50%, 0 50%);\n            color: #f0f;\n            animation: shiftright 2s steps(2) infinite;\n        }\n\n        body div#error h3:after {\n            clip-path: polygon(0 100%, 100% 100%, 100% 50%, 0 50%);\n            color: #0ff;\n            animation: shiftleft 2s steps(2) infinite;\n        }\n\n        body div#error p {\n            position: relative;\n            margin-bottom: 8px;\n        }\n\n        body div#error p span {\n            position: relative;\n            display: inline-block;\n            font-weight: bold;\n            color: #000;\n            animation: blink 3s steps(1) infinite;\n        }\n\n        body div#error p span:before,\n        body div#error p span:after {\n            content: \'unstable\';\n            position: absolute;\n            top: -1px;\n            left: 0;\n            mix-blend-mode: multiply;\n        }\n\n        body div#error p span:before {\n            clip-path: polygon(0 0, 100% 0, 100% 50%, 0 50%);\n            color: #f0f;\n            animation: shiftright 1.5s steps(2) infinite;\n        }\n\n        body div#error p span:after {\n            clip-path: polygon(0 100%, 100% 100%, 100% 50%, 0 50%);\n            color: #0ff;\n            animation: shiftleft 1.7s steps(2) infinite;\n        }\n\n        @-moz-keyframes dance {\n\n            0%,\n            84%,\n            94% {\n                transform: skew(0deg);\n            }\n\n            85% {\n                transform: skew(5deg);\n            }\n\n            90% {\n                transform: skew(-5deg);\n            }\n\n            98% {\n                transform: skew(3deg);\n            }\n        }\n\n        @-webkit-keyframes dance {\n\n            0%,\n            84%,\n            94% {\n                transform: skew(0deg);\n            }\n\n            85% {\n                transform: skew(5deg);\n            }\n\n            90% {\n                transform: skew(-5deg);\n            }\n\n            98% {\n                transform: skew(3deg);\n            }\n        }\n\n        @-o-keyframes dance {\n\n            0%,\n            84%,\n            94% {\n                transform: skew(0deg);\n            }\n\n            85% {\n                transform: skew(5deg);\n            }\n\n            90% {\n                transform: skew(-5deg);\n            }\n\n            98% {\n                transform: skew(3deg);\n            }\n        }\n\n        @keyframes dance {\n\n            0%,\n            84%,\n            94% {\n                transform: skew(0deg);\n            }\n\n            85% {\n                transform: skew(5deg);\n            }\n\n            90% {\n                transform: skew(-5deg);\n            }\n\n            98% {\n                transform: skew(3deg);\n            }\n        }\n\n        @-moz-keyframes shiftleft {\n\n            0%,\n            87%,\n            100% {\n                transform: translate(0, 0) skew(0deg);\n            }\n\n            84%,\n            90% {\n                transform: translate(-8px, 0) skew(20deg);\n            }\n        }\n\n        @-webkit-keyframes shiftleft {\n\n            0%,\n            87%,\n            100% {\n                transform: translate(0, 0) skew(0deg);\n            }\n\n            84%,\n            90% {\n                transform: translate(-8px, 0) skew(20deg);\n            }\n        }\n\n        @-o-keyframes shiftleft {\n\n            0%,\n            87%,\n            100% {\n                transform: translate(0, 0) skew(0deg);\n            }\n\n            84%,\n            90% {\n                transform: translate(-8px, 0) skew(20deg);\n            }\n        }\n\n        @keyframe